  \"Final Report: Influence of Food Availability on Black Bear Bait Station Visits
  in Southeastern Georgia\",\n\t\"tracking_summary\": {\n\t\t\"total\": 6,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:54:50.383981\",\n\t\"name\": \"final-report-influence-of-food-availability-on-black-bear-bait-station-visits-in-southeast\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes findings related
  to bait station techniques to assess black bear status in the Greater Okefenokee
  landscape, and provides guidance on how to continue monitoring for black bears.
  One hundred twenty bait stations were established and baited with sardines on Dixon
  Memorial Wildlife Management Area in southeast Georgi~ for the third year of testing
  a bait station technique to index black bears (Ursusu00b7 americanus). Stations
  were baited in May and July of 1993 and checked after 5 and 8 days. Line transects
  were established for each bait station location. Plants with suspected food value
  for bears were identified on four plots on each transect and food availability was
  ranked foreach station. Chi-square analyses indicated no differences between bear
  visits during May or July 1993 or when visits for May and July 1993 were combined
  . z statistic comparisons indicated significant differences between years for May
  91 vs. 92 (P = 0.012), 91 vs. 93 (P <0.001), and 92 vs. 93 (P = 0.011). There were
  also annual differences for July 91 vs. 92 (P <0.001) and 91 vs. 93 (P < 0.001)
  but not for July 92 vs. 93. T-test analyses indicated no significant relationship
  between food availability and bear visits at bait sites during May and July 1993.
  11 Food values . , however, were higher in May than in July, 1993 (P = 0.000).\",\n\t\"license_title\":
